disa=0;

dx=u*cos(psi)-disa*w*sin(psi);
dy=u*sin(psi)+disa*w*cos(psi);
dpsi=w;

JA = [
 
[ 1, 0, - b*sin(psi) - l3*cos(q3)*((4967757600021511*cos(psi + q1)*sin(q2))/81129638414606681695789005144064 + sin(psi + q1)*cos(q2)) - l3*sin(q3)*((4967757600021511*cos(psi + q1)*cos(q2))/81129638414606681695789005144064 - sin(psi + q1)*sin(q2)) - (4967757600021511*l2*cos(psi + q1)*sin(q2))/81129638414606681695789005144064 - l2*sin(psi + q1)*cos(q2), - l3*cos(q3)*((4967757600021511*cos(psi + q1)*sin(q2))/81129638414606681695789005144064 + sin(psi + q1)*cos(q2)) - l3*sin(q3)*((4967757600021511*cos(psi + q1)*cos(q2))/81129638414606681695789005144064 - sin(psi + q1)*sin(q2)) - (4967757600021511*l2*cos(psi + q1)*sin(q2))/81129638414606681695789005144064 - l2*sin(psi + q1)*cos(q2), - l3*cos(q3)*(cos(psi + q1)*sin(q2) + (4967757600021511*sin(psi + q1)*cos(q2))/81129638414606681695789005144064) - l3*sin(q3)*(cos(psi + q1)*cos(q2) - (4967757600021511*sin(psi + q1)*sin(q2))/81129638414606681695789005144064) - l2*cos(psi + q1)*sin(q2) - (4967757600021511*l2*sin(psi + q1)*cos(q2))/81129638414606681695789005144064, - l3*cos(q3)*(cos(psi + q1)*sin(q2) + (4967757600021511*sin(psi + q1)*cos(q2))/81129638414606681695789005144064) - l3*sin(q3)*(cos(psi + q1)*cos(q2) - (4967757600021511*sin(psi + q1)*sin(q2))/81129638414606681695789005144064)];...
[ 0, 1,   b*cos(psi) + l3*cos(q3)*(cos(psi + q1)*cos(q2) - (4967757600021511*sin(psi + q1)*sin(q2))/81129638414606681695789005144064) - l3*sin(q3)*(cos(psi + q1)*sin(q2) + (4967757600021511*sin(psi + q1)*cos(q2))/81129638414606681695789005144064) + l2*cos(psi + q1)*cos(q2) - (4967757600021511*l2*sin(psi + q1)*sin(q2))/81129638414606681695789005144064,   l3*cos(q3)*(cos(psi + q1)*cos(q2) - (4967757600021511*sin(psi + q1)*sin(q2))/81129638414606681695789005144064) - l3*sin(q3)*(cos(psi + q1)*sin(q2) + (4967757600021511*sin(psi + q1)*cos(q2))/81129638414606681695789005144064) + l2*cos(psi + q1)*cos(q2) - (4967757600021511*l2*sin(psi + q1)*sin(q2))/81129638414606681695789005144064,   l3*cos(q3)*((4967757600021511*cos(psi + q1)*cos(q2))/81129638414606681695789005144064 - sin(psi + q1)*sin(q2)) - l3*sin(q3)*((4967757600021511*cos(psi + q1)*sin(q2))/81129638414606681695789005144064 + sin(psi + q1)*cos(q2)) + (4967757600021511*l2*cos(psi + q1)*cos(q2))/81129638414606681695789005144064 - l2*sin(psi + q1)*sin(q2),   l3*cos(q3)*((4967757600021511*cos(psi + q1)*cos(q2))/81129638414606681695789005144064 - sin(psi + q1)*sin(q2)) - l3*sin(q3)*((4967757600021511*cos(psi + q1)*sin(q2))/81129638414606681695789005144064 + sin(psi + q1)*cos(q2))];...
[ 0, 0,                                                                                                                                                                                                                                                                                                                                                        0,                                                                                                                                                                                                                                                                                                                                           0,                                                                                                                                                                                                                                                                                        l2*cos(q2) + l3*cos(q2)*cos(q3) - l3*sin(q2)*sin(q3),                                                                                                                                                                                           l3*cos(q2)*cos(q3) - l3*sin(q2)*sin(q3)]];
 
dqee=[dx dy dpsi dq1 dq2 dq3];

dhee=JA*dqee.';

yf=dhee;
